const getBiometricResult = (
    resident,
    data,
) => {
    const common = ['liveness_result', 'face2face_result'];
    const parameters = resident
        ? ['edocument_result', ...common]
        : ['document_recognition_result', ...common];
    let results = 0,
        commonResults = 0;

    for (const parameter of parameters) {
        if (data[parameter]?.failure_reason) results++;
    }

    for (const parameter of common) {
        if (data[parameter]?.result) commonResults++;
    }
    console.log(commonResults);
    console.log(results);
    return results === 0 && common.length === commonResults;
};

